import { useState, useEffect } from 'react';

function Players() {

    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('http://127.0.0.1:8000/api/app/')
        .then(res => res.json())
        .then(data => {
            setData(data);
        })
        .catch(err => {
            console.log(err);
        });
    }, []);

    return (
        <div id="players-main">
            <h1>Players</h1>
            {data.map((player) => {
                const { name, price, total_points, minutes, ppm, ppp, ppppm } = player;
                return (
                    <Player name={name} price={price} total_points={total_points}
                    minutes={minutes} ppm={ppm} ppp={ppp} ppppm={ppppm} />
                )
            })}
        </div>
    )
}

function Player(props) {
    return (
        <div id="player-box">
            <p>{props.name}</p>
            <p>{props.price}</p>
            <p>{props.total_points}</p>
            <p>{props.minutes}</p>
            <p>{props.ppm}</p>
            <p>{props.ppp}</p>
            <p>{props.ppppm}</p>
        </div>
    )
}



export default Players;
